import React from 'react'
import Styles from './mainContainer.module.css'
import AUX from '../HOC/AUX'

export default function MainContainer(props) {
    return (
        <AUX>
            <div className={Styles.mainContainer}>
                {props.children}
            </div>
        </AUX>
    )
}
